import React, { Component } from "react";

class Login extends Component {

	render() {
		return (
			<div>
				<button
					//onCLick={() => this.props.onClicked}
					className="btn btn-seconday btn-sm"
				>
					Login
			</button>
			</div>
		);
	}
}

export default Login;
